div.font:
class S3client(object):
# метод проверки на существование изображения в s3, где bucket - название хранилища
def file_exist(self, bucket, prefix):
try:
self.s3_client.head_object(Bucket=bucket, Key=prefix)
except botocore.exceptions.ClientError:
return False
return True
# метод загрузки файла в s3 хранилище из expected директории, где object_name это expected_file
def upload_file(self, bucket, file_name, object_name):
try:
self.s3_client.download_file(bucket, file_name, object_name)
except botocore.exceptions.ClientError:
return False
return True

div.span:
def download_file(self, busket, file_name, object_name):
try:
self.s3_client.download_file(busket, file_name, object_name)
except botocore.exceptions.ClientError:
return False
return True

