# метод вычисления допустимой разницы в пикселях, где sensitivity по умолчанию 0.33 процента
def calculate_distance(page, language, name, browser_name, width, sensitivity=300):
screen_width, screen_height = Image.open(expected_dir(browser_name, page, language, name, width)).size
return (screen_height * screen_width) / sensitivity
