class ScreenShooter(object):
# метод определения чувствительности попиксельной проверки скриншотов, где x - количество столбцов в скрине, y - количество строк
def process_region(image, x, y, width, height):
region_total = 0
factor = 100 # индикатор чувствительности
for coordinateY in range(y, y + height):
for coordinateX in range(x, x + width):
try:
pixel = image.getpixel((coordinateX, coordinateY))
region_total += sum(pixel) / 4
except IndexError:
pass # Временная заглушка IndexError
except (FileNotFoundError, IOError):
return
return region_total / factor
